// Prepare context for AI chat agent using existing documents table

const userMessage = $('Webhook - Chat Input').item.json.body.message;
const validationDetailId = $json.validation_detail_id;

const documents = $('Fetch Validation Documents').first().json;
const promptTemplate = $('Fetch Chat Prompt Template').first().json;

// Build document context from validation_documents table
let documentContext = '';
if (Array.isArray(documents) && documents.length > 0) {
  documentContext = `
**AVAILABLE DOCUMENTS** (${documents.length} files):
${documents.map((d, i) => `${i + 1}. ${d.file_name} (${d.document_type || 'Document'})
   - Uploaded: ${new Date(d.created_at).toLocaleString()}
   - Storage Path: ${d.storage_path}
   - Gemini URI: ${d.gemini_file_uri}`).join('\n')}

**IMPORTANT**: Reference these documents when relevant to provide evidence-based responses.
`;
} else {
  documentContext = '\n**NOTE**: No documents are available for this validation.';
}

// Build context string
const contextString = `
**CONTEXT**
────────────────────────────────────────────────────────────────────
Validation Detail ID: ${validationDetailId}
────────────────────────────────────────────────────────────────────
`;

// Build full prompt with context
const systemPrompt = promptTemplate?.system_instruction || 
  'You are a helpful AI assistant. Provide clear, accurate, and contextually relevant responses.';

const fullPrompt = `${systemPrompt}

${contextString}

${documentContext}

**USER MESSAGE**:
${userMessage}

Please provide a helpful response to the user's message. Reference documents when relevant.`;

return {
  json: {
    validation_detail_id: validationDetailId,
    user_message: userMessage,
    system_prompt: systemPrompt,
    full_prompt: fullPrompt,
    documents: documents || [],
    prompt_template: promptTemplate
  }
};

// Build Gemini request with proper context and document handling
const context = $input.item.json;

// Convert documents to array
const documents = Array.isArray(context.documents) 
  ? context.documents 
  : (context.documents ? [context.documents] : []);

// Build file parts from documents - ONLY if they have gemini_file_uri
const fileParts = documents
  .filter(doc => doc.gemini_file_uri)
  .map(doc => ({
    fileData: {
      mimeType: doc.mime_type || 'application/pdf',
      fileUri: doc.gemini_file_uri
    }
  }));

// Build conversation history context
const conversationHistory = context.conversation_history || [];
const historyText = conversationHistory.length > 0
  ? `\n**CONVERSATION HISTORY**:\n${conversationHistory.map(msg => 
      `${msg.role === 'user' ? 'User' : 'Assistant'}: ${msg.content}`
    ).join('\n')}\n`
  : '';

// Determine document status message
const documentStatus = fileParts.length > 0
  ? `**DOCUMENTS ATTACHED**: ${fileParts.length} document(s) available for reference:\n${documents.filter(d => d.gemini_file_uri).map(d => `  - ${d.file_name}`).join('\n')}`
  : '**NOTE**: No documents are currently available for this validation.';

// Build clean user prompt (NO system instruction duplication)
const userPrompt = `**CONTEXT**
────────────────────────────────────────────────────────────────────
Validation Detail ID: ${context.validation_detail_id || 'N/A'}
────────────────────────────────────────────────────────────────────

${documentStatus}
${historyText}
**USER MESSAGE**:
${context.user_message}

Please analyze the attached document(s) and provide a helpful, detailed response to the user's question. Include specific page numbers when referencing information from the document(s).`;

// Build Gemini request
const geminiRequest = {
  systemInstruction: {
    parts: [{
      text: context.system_prompt
    }]
  },
  contents: [
    {
      role: 'user',
      parts: [
        ...fileParts,  // Attach document files FIRST
        {
          text: userPrompt  // Then the clean user prompt
        }
      ]
    }
  ],
  generationConfig: {
    temperature: context.prompt_template?.generation_config?.temperature || 0.7,
    maxOutputTokens: context.prompt_template?.generation_config?.maxOutputTokens || 4096,
    topP: context.prompt_template?.generation_config?.topP || 0.95,
    topK: context.prompt_template?.generation_config?.topK || 40,
    responseMimeType: "application/json",
    responseSchema: context.prompt_template?.output_schema || {
      type: "object",
      required: ["response"],
      properties: {
        response: {
          type: "string",
          description: "The assistant response to the user query"
        },
        confidence: {
          type: "number",
          minimum: 0,
          maximum: 1,
          description: "Confidence level of the response (0-1)"
        },
        document_references: {
          type: "array",
          items: {
            type: "object",
            properties: {
              page: { type: "integer" },
              section: { type: "string" },
              file_name: { type: "string" }
            }
          },
          description: "References to documents cited in the response"
        }
      }
    }
  }
};

// Return enhanced context
return {
  json: {
    validation_detail_id: context.validation_detail_id,
    user_message: context.user_message,
    documents_available: fileParts.length > 0,
    document_count: fileParts.length,
    gemini_request: geminiRequest
  }
};

